script: |
  super -f text -I q12863.spq | sort > q12863.out

inputs:
  - name: q12863.spq
    data: |
      SELECT ALL - 79 FROM tab0 (FORMAT parquet) WHERE NOT ( - + col1 * col0 ) BETWEEN + col2 AND + CAST ( 28 AS INTEGER ) * - col1;
  - name: tab0

outputs:
  - name: q12863.out
    data: |
      -79
      -79
      -79
